import React from "react";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";
import Page1 from "./components/pages/Page1";
import Page2 from "./components/pages/Page2";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <Page1 />
        </Route>
        <Route path="/page2" exact>
          <Page2 />
        </Route>
        <Redirect to="/" />
      </Switch>
    </BrowserRouter>
  );
}
export default App;
